const Child = ({name}) => {

    function pressButton(){
        alert(`Default Text`);
    }

    function pressButtonParams(text){
        alert(`Text: ${text}`);
    }


    return (
        <div>
            <p>Child Component</p>
            <button onClick={()=>console.log('Child Component1 Click')}>Boton 1</button>
            <button onClick={()=>console.log('Child Component2 Click')}>Boton 2</button>
        </div>
    );
}

export default Child;
